import React from 'react';

function Profile() {
    var loggedinuser = sessionStorage.getItem('currentUser'); 
    const innerHTML = {__html: 'Welcome, ' + loggedinuser}

    return(
        <div>
            
        <div dangerouslySetInnerHTML={innerHTML} />

        <h1>Profile</h1>

        <b>First Name: </b>
        <br/>
        <b>Last Name: </b>

        <br/>

        <h1>Past Orders</h1>

        </div>
    )
}

export default Profile;
